//Function to update test steps of entire test suite from external files 
void UpdateTestSteps(String SuiteName)
{
	//Get ProjectFiles folder path
	String ProjectFilesPATH  = new File(context.expand('${projectDir}')).getParent() + "\\ProjectFiles"

	def groovyfilesPath = ProjectFilesPATH + "\\GroovyFiles"
	def contractfilesPath = ProjectFilesPATH + "\\ContractFiles"

	//Setting the test runner with the test case name
	def testCasesList

	testCasesList = project.testSuites[SuiteName].getTestCaseList()

	testCasesList.each{
		String data 
		def StepList = it.getTestStepList()

		StepList.each{
			String filePath = ""
			String stepType = it.config.type //.equalsIgnoreCase("request")		
			String stepName = it.name.contains('-') ? it.name.split('-')[0] : it.name

			if(stepType.equalsIgnoreCase("request"))
			{
				//Identify file path
				new File(contractfilesPath).eachFileRecurse (groovy.io.FileType.FILES) { file->
			         if(file.getAbsolutePath().endsWith(stepName + ".txt")){
			         	filePath = file.getAbsolutePath();
			         }
			      }

			      //Update request xml content
			      if(filePath != ""){
			      	data = new String(Files.readAllBytes(Paths.get(filePath)));
		           	it.setPropertyValue('Request',data)
					log.info "Updated request content of step - " + stepName + ": Filepath - " + filePath
			      }

				 //Updating Endpoint URL for every request step as provided in Config file
		           def XmlData = new XmlSlurper().parseText(data)
		           String contractName = XmlData.Body.children()*.name()[0]
		           it.getHttpRequest().setEndpoint(context.expand('${#Project#' + "Endpoint_" + contractName + '}'))

			}
			else if(stepType.equalsIgnoreCase("groovy"))
			{
				//Identify file path
				new File(groovyfilesPath).eachFileRecurse (groovy.io.FileType.FILES) { file->
			         if(file.getAbsolutePath().endsWith(stepName + ".txt")){
			         	filePath = file.getAbsolutePath();
			         }
			      }

				 //Update script content
			      if(filePath != "")
			      {					
				      //Read Groovy script from external file
				      StringBuffer buffer = new StringBuffer(); //Adding this logic, since special characters are behaving/read incorrectly with prior logic
					    try {
					        FileInputStream fis = new FileInputStream(filePath);
					        InputStreamReader isr = new InputStreamReader(fis, "UTF8");
					        Reader rdr = new BufferedReader(isr);
					        int ch;
					        while ((ch = rdr.read()) > -1) {
					            buffer.append((char)ch);
					        }
					        rdr.close();
					        data = buffer.toString();
					    } 
					    catch (IOException e) {
					        e.printStackTrace();
					        return null;
					    }

	                	it.setPropertyValue('script',data)
					log.info "Updated script content of step - " + stepName + ": Filepath - " + filePath
			      }
			}

		}
	}
}

